Text:
@nippsy71 @Paul_Ainscow So the last 90mins Is all that matters? 

What about the 3 years without a trophy? The poor first half today? Leicester on Saturday? 

Scholes is looking at the bigger picture.

@DanHTimms89 We all did, I don't know where this has come from but absolutely fair play to him. 

Take at look at Rio if you want to see an Ole fan. 

P.s never said Scholes was a glazer puppet.

@thewestcorkbull @KarlaHilton1 @ABZ48355139 Which one gets ole sacked 

Atalanta win or United win? 

You want to paper over cracks and having ole for another season, shame on you

@thewestcorkbull @ABZ48355139 2-0 

Imagine wanting this to continue

Shame on you

@thewestcorkbull Let me just put it into context for you, this isn't even is worst start to a season and he's still in a job. 

He hasn't won a trophy in 3 years, bottled it against Villareal and he's still in a job. 

Is it any wonder fans are sick of individual games papering over cracks?

@thewestcorkbull Not worthy if consideration when last season every other major club who could have stopped us taking 2nd had injuries, changing managers and city didn't even have a striker. 

Not to mention the Villareal debacle

When fans start hoping the team loses it says more about the board

@thewestcorkbull You know top 3 isn't an accomplishment right? 

Winning trophies beats finishing 2nd and 3rd, it's madness I have to explain this. 

The reason fans have got to this stage is because unlike Chelsea, our board haven't done their job and fired the failing manager.

@chruscinski1980 @pert_brian That's a nice story bro but only problem is that it's based in pure fantasy. 

How many trophies have those "dead players" won since the were re awoken by Ole? None. 

I couldn't care less if Luke Shaw it's man enough to take critcisms, I care we have a manager who's winning

@Dav3woodbridg3 @lauriewhitwell @TheAthleticUK Literally the whole point of the tweet is the find the issue with United at the moment. 

"Lots to do to find team balance in/out of possession." 

Using Ronaldo stats in context with finding the problem, makes it an excuse for Oles lack of tactics

